import React from 'react';

import Nav from './components/Nav/Nav';
import HorizontalNav from './components/Nav/HorizontalNav/HorizontalNav';
import './App.css';

const App = () => {
  return (
    <div className="App">
      <Nav />
      <HorizontalNav />
    </div>
  );
}

export default App;
